import './App.css';
import { useEffect, useState } from 'react';
import Header from './Components/Header';
import Home from './Components/Home/Home';
import Quez from './Components/Quez';
import Menu from './Components/Menu';
import {
  BrowserRouter,
  Routes,
  Route,
} from 'react-router-dom'
import axios from 'axios';

function App() {
  const [status, setStatus] = useState('')
  // setStatus('1')


  return (
    <div className="App">
      <Header />
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Home setStatus={setStatus} />} />
          <Route path='/menu/:sectionNum' element={<Menu status={status}/>} />
          <Route path='/quez/:sectionNum' element={<Quez />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
